import React from "react";
const data = [
  { Problem_Statement: "Anom", PS_no: 19, Short_draft: "Male" },
  { Problem_Statement: "Megha", PS_no: 19, Short_draft: "Female" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
  { Problem_Statement: "Anom", PS_no: 19, Short_draft: "Male" },
  { Problem_Statement: "Megha", PS_no: 19, Short_draft: "Female" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
  { Problem_Statement: "Anom", PS_no: 19, Short_draft: "Male" },
  { Problem_Statement: "Megha", PS_no: 19, Short_draft: "Female" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
  { Problem_Statement: "Anom", PS_no: 19, Short_draft: "Male" },
  { Problem_Statement: "Megha", PS_no: 19, Short_draft: "Female" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
  { Problem_Statement: "Anom", PS_no: 19, Short_draft: "Male" },
  { Problem_Statement: "Megha", PS_no: 19, Short_draft: "Female" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
  { Problem_Statement: "Subham", PS_no: 25, Short_draft: "Male" },
];

function Table() {
  return (
    <div classProblem_Statement="App">
      <table>
        <tr>
          <th>Problem_Statement</th>
          <th>PS_no</th>
          <th>Short_draft</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.Problem_Statement}</td>
              <td>{val.PS_no}</td>
              <td>{val.Short_draft}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}
export default Table;
